                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                        </tr>
                    </tbody>
                </table>


            </div>
        )
    }

    componentDidMount(){
        this.props.fetchData({page:1})
    }
}

const mapStateToProps = state => {
    return {
      data: state.data
    }
  }

  const mapDispatchToProps = dispatch => {
    return {
      fetchData: data => dispatch(fetchDataInit(data))
    }
  }

export default connect(mapStateToProps, mapDispatchToProps)(Expectancy);
